package week1.day1.assignments;

public class OddNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("Printing Only Numbers From 1 to 20");
		for(int i=1;i<=20;i++) {
			if(i%2!=0) {
				System.out.println(i);
			}
		
		}

	}

}
